const baseUrl = "http://localhost:8080/foodpanda"
import axios from "axios";
const customer = {};

customer.create = async (username, password) => {

  const datapost = {
    password: password,
    username: username
  }

  const urlPost = baseUrl+"/customer"

  const res = await axios.get(urlPost,datapost)
  .then(response=>{ return response.data; })
  .catch(error=>{ return error.response; })
  
  return res;
}

export default customer
